import React, { useState } from 'react';
import Sidebar from '../../../Component/SideBar/Sidebar';
import { FaChartBar, FaRoute } from 'react-icons/fa';
import './Cityoperation.css';

export default function Cityoperation() {
  const [searchTerm, setSearchTerm] = useState('');

  const cities = [
    { city: 'Mumbai', deliveries: 45, pending: 3, volume: '1125.0K L' },
    { city: 'Delhi', deliveries: 38, pending: 2, volume: '950.0K L' },
    { city: 'Bangalore', deliveries: 32, pending: 1, volume: '800.0K L' },
  ];

  const filteredCities = cities.filter(c =>
    c.city.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="city-operations-container">
      <Sidebar />
      <div className="city-operations-content">
        <h1>City Operations</h1>

        <div className="search-bar">
          <input
            type="text"
            placeholder="Search cities..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
        </div>

        <div className="city-cards">
          {filteredCities.map(({ city, deliveries, pending, volume }) => (
            <div className="city-card" key={city}>
              <h2>{city}</h2>
              <p className="hub-label">Operations Hub</p>
              <div className="status active">🟢 Active</div>
              <div className="details">
                <div><p>Total Deliveries</p><h3>{deliveries}</h3></div>
                <div><p>Pending</p><h3>{pending}</h3></div>
                <div><p>Total Volume</p><h3>{volume}</h3></div>
              </div>
              <div className="actions">
                <button><FaChartBar /> View Analytics</button>
                <button><FaRoute /> Manage Routes</button>
              </div>
            </div>
          ))}
        </div>

        <div className="operations-summary">
          <div><p>Total Deliveries</p><h3>115</h3></div>
          <div><p>Pending Deliveries</p><h3>6</h3></div>
          <div><p>Total Volume (L)</p><h3>2.9M</h3></div>
          <div><p>Active Cities</p><h3>3</h3></div>
        </div>
      </div>
    </div>
  );
}
